import React, { useState, Component } from 'react';
import logo from './logo.svg';
import './App.css';
import List from "./components/List";
import AddToList from './components/AddToList';

export interface IState {
    toys: {
        classType: string
        name: string
        size: string
        producerId : number
        numberOfWheels? : number
        url: string
        note?: string
    }[]
}

function App() {

  const [toys, setToys] = useState<IState["toys"]>([{
      classType: "Car",
      name: "Ford GT40 ",
      size: "XL",
      producerId: 1,
      numberOfWheels: 4,
      url: "https://media-exp1.licdn.com/dms/image/C5603AQGhYSxOlmSe6g/profile-displayphoto-shrink_800_800/0/1525950837905?e=2147483647&v=beta&t=9HGdvzUYNd3V7GI4ISJEo3aXUwL3JSfqVgsO3jF-GJY",
      note: "Cutest lady in the universe",
  }
  ])

  return (
      <div className="App">
        <h1>.:EOS:. Toy Store</h1>
          <h2>Toys in the inventory</h2>
        <List toys={toys}/>
        <AddToList setToys={setToys} toys={toys}/>
      </div>
  );
}

export default App;
